import React from "react";
import { useState } from "react";
import ListBox from "./ListBox";
import WatchedBox from "./WatchedBox";

function Main({ movies }) {
  return (
    <main className="main">
      <ListBox movies={movies} />
      <WatchedBox />
    </main>
  );
}

export default Main;
